        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. PEDAGOGICAL OBJECTIVES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine of the program </h3>
                <p class=""description""> 
                    Logistic chain deals with the whole of the management of flows of materials or goods. With this intention, it directly manages the activities
                    concerned, in order to control:
                </p>
                <ul class=""one_list"">
                    <li> flows and stocks of finished products, in progress, semi-finished, raw materials, etc. ; </li>
                    <li> internal human resources or external providers such as suppliers, warehousing, transport, f");
            WriteLiteral(@"reight forwarders, etc.; </li>
                    <li> equipment needed to carry out the logistics service (warehouses, tools, machines, handling, clean vehicles, etc.); </li>
                    <li> supplies (packaging, consumables, energy sources and fuels, etc.); </li>
                    <li> services (planning, shopping, packing, handling, transport, export, customs, billing, litigation, etc.); </li>
                    <li> information and management control systems. </li>
                </ul>
                <p class=""description""> 
                    The Logistics and Transport Management program provided by the Business Intelligence Institute is supported by specialized courses in
                    logistical and transport operations to equip students with the management of the logistics chain.
                </p>    
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectives of the program </h3>
                <h3 cl");
            WriteLiteral(@"ass=""smaller_heading""> II.2.1. General objective</h3>
                <p class=""description""> 
                    The objective of this program is to train multi-skilled graduates in the management and inventory management of companies and in particular
                    with a strong knowledge of logistics and transportation operations. By the end of this program, graduates will be able to take advantage of skills
                    acquired in different mining companies and also in private and public companies.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific Objectives </h3>
                <p class=""description""> 
                    <strong> Commun run with the mention </strong><br/>
                    The student, at the end of this program will be able to: <br/>
                </p>
                <ul class=""one_list"">
                    <li> Assist companies in the control of their logistics exploitation issues; </li>
                    <li> Ens");
            WriteLiteral(@"ure the regular monitoring of inventory management in the various sites or specific missions; </li>
                    <li> Develop provisional budgets in logistics matters; </li>
                    <li> Control transport management; </li>
                    <li> Control, verify, inspect, critically monitor company equipment. </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approach to the program </h3>
                <p class=""description""> 
                    The program prepares for the Supply and Inventory Management course, which aims to prepare for stock manager or storekeeper careers for
                    private and public enterprises and non-governmental organizations.
                </p>

            </div>

